import './App.css';

function App() {
  console.log("Hello!");

  const reqBody = {
    "username": "trevor",
    "password": "asdfasdf"
  }


  fetch("api/auth/login", {
    headers: {
      "Content-Type":"application/json",
    },
    method: "post",
    body: JSON.stringify(reqBody)
  }).then((response) => Promise.all([response.json(), response.headers]))
    .then(([body,headers]) => {
      const { authorization } = {...headers};
      console.log(authorization);
    });

  return (
    <div className="App">
      Hello World
    </div>
  );
}

export default App;
